import { Route, Switch } from 'react-router-dom';
import Hero from './components/Hero';
import Header from './components/Header';
import Home from './components/Home';

function App() {
  return (
    <Switch>
      <Route exact path="/">
        <Header />
        <Hero />
      </Route>
    </Switch>
  );
}

export default App;
